import React from "react";
import "./App.css";
import { useApiGet, TApiResponse } from "./hooks/useApiHook";

const response = await fetch(
  `https://restcountries.com/v3/alpha/${countrycode}`
);
let json = await response.json();
console.log("this is my json file: ", json.borders);

const App: React.FC = () => {
  // call to the hook
  const data: TApiResponse = useApiGet("https://restcountries.com/");

  // print the output
  if (!data.loading) console.log(data);

  return <div className="App"></div>;
};

export default App;
